Release Date  1961
Category  Clasicc 
Director  Doris Wishman
Starring  Dolores Carlos, Patricia Conelle, Maria Stinger

It's a nudie cutie double feature! First, a female investigative reporter goes undercover (and unclothed) at the Sunny Palms Lodge, where members do everything in the buff in director Doris Wishman's &quot;Diary of a Nudist.&quot; Next, an American boy and a French girl fall in love, but are kept apart because she's a member of a nudist colony! Will they &quot;uncover&quot; true happiness? Patricia Conelle stars.
